function getMultify(multify) {

function getAllUnit(length, arr) {
    // 3, [1,2,3,4,5]
    // [[1,2,3],[2,3,4],[3,4,5]]

    if (length === 1) {
      for (var i = 0; i < arr.length; i++) {
        let c = [];
        c.push(arr[i]);
        unit.push(c);
      }
